(1452, 115, 'bptt_repeater_0_bptt__scroll-anchor', '1'),
(1453, 115, '_bptt_repeater_0_bptt__scroll-anchor', 'field_5a36e5e346b7c'),
(1454, 115, 'bptt_repeater_0_bptt__icon', '46'),
(1455, 115, '_bptt_repeater_0_bptt__icon', 'field_5a36e5b146b7b'),
(1456, 115, 'bptt_repeater_0_bptt__text', 'HYBUILTS manufacturing process is the most efficient in the industry. This allows our continuous determination in lowering the cost of materials made possible across our clientele and customer base. HYBUILT Concrete sleepers are Certified by Registered Professional Engineers of Queensland (RPEQ). They are an Australian Manufactured Product meeting all Australian Building Standards.'),
(1457, 115, '_bptt_repeater_0_bptt__text', 'field_5a36e62546b7d'),
(1458, 115, 'bptt_repeater', '3'),
(1459, 115, '_bptt_repeater', 'field_5a36e58d46b7a'),
(1460, 115, 'bptt_repeater_0_bptt__title', 'Manufacturing'),
(1461, 115, '_bptt_repeater_0_bptt__title', 'field_5a36ec565e795'),
(1462, 115, 'bptt_repeater_1_bptt__icon', '55'),
(1463, 115, '_bptt_repeater_1_bptt__icon', 'field_5a36e5b146b7b'),
(1464, 115, 'bptt_repeater_1_bptt__scroll-anchor', '2'),
(1465, 115, '_bptt_repeater_1_bptt__scroll-anchor', 'field_5a36e5e346b7c'),
(1466, 115, 'bptt_repeater_1_bptt__title', 'Delivery'),
(1467, 115, '_bptt_repeater_1_bptt__title', 'field_5a36ec565e795'),
(1468, 115, 'bptt_repeater_1_bptt__text', 'We’re Queensland’s most efficient internal crane truck door to door/site to site services. Depending on the order size HYBUILT can usually deliver your materials within 2-3 days after order confirmation. To efficiently carry out these duties HYBUILT operates an entire fleet of Crane Trucks in a variety of sizes to suit both Load size and/or potential access constraints.'),
(1469, 115, '_bptt_repeater_1_bptt__text', 'field_5a36e62546b7d'),
(1470, 115, 'bptt_repeater_2_bptt__icon', '60'),
(1471, 115, '_bptt_repeater_2_bptt__icon', 'field_5a36e5b146b7b'),
(1472, 115, 'bptt_repeater_2_bptt__scroll-anchor', ''),
(1473, 115, '_bptt_repeater_2_bptt__scroll-anchor', 'field_5a36e5e346b7c'),
(1474, 115, 'bptt_repeater_2_bptt__title', 'Warranty'),
(1475, 115, '_bptt_repeater_2_bptt__title', 'field_5a36ec565e795'),
(1476, 115, 'bptt_repeater_2_bptt__text', 'HYBUILT’s 30yr Guarantee is applicable to walls that have been constructed to our design and specifications. Should a wall fail due to materials tampering, negligence and/or incorrect installation methods the warranty is void. However, should our products fail (without any external variables) we will replace them.'),
(1477, 115, '_bptt_repeater_2_bptt__text', 'field_5a36e62546b7d'),
