(1835, 118, 'bptt_repeater_0_bptt__scroll-anchor', '1'),
(1836, 118, '_bptt_repeater_0_bptt__scroll-anchor', 'field_5a36e5e346b7c'),
(1837, 118, 'bptt_repeater_0_bptt__icon', '46'),
(1838, 118, '_bptt_repeater_0_bptt__icon', 'field_5a36e5b146b7b'),
(1839, 118, 'bptt_repeater_0_bptt__text', 'HYBUILTS manufacturing process is the most efficient in the industry. This allows our continuous determination in lowering the cost of materials made possible across our clientele and customer base. HYBUILT Concrete sleepers are Certified by Registered Professional Engineers of Queensland (RPEQ). They are an Australian Manufactured Product meeting all Australian Building Standards.'),
(1840, 118, '_bptt_repeater_0_bptt__text', 'field_5a36e62546b7d'),
(1841, 118, 'bptt_repeater', '3'),
