(1856, 118, '_bptt_repeater_2_bptt__scroll-anchor', 'field_5a36e5e346b7c'),
(1857, 118, 'bptt_repeater_2_bptt__title', 'Warranty'),
(1858, 118, '_bptt_repeater_2_bptt__title', 'field_5a36ec565e795'),
(1859, 118, 'bptt_repeater_2_bptt__text', 'HYBUILT’s 30yr Guarantee is applicable to walls that have been constructed to our design and specifications. Should a wall fail due to materials tampering, negligence and/or incorrect installation methods the warranty is void. However, should our products fail (without any external variables) we will replace them.'),
