(2024, 118, '_csp_b-p-repeater_1_prd-opt2_opt-end-para', 'field_5a3719257ffbc'),
(2025, 119, 'bptt_repeater_0_bptt__scroll-anchor', '1'),
(2026, 119, '_bptt_repeater_0_bptt__scroll-anchor', 'field_5a36e5e346b7c'),
(2027, 119, 'bptt_repeater_0_bptt__icon', '46'),
(2028, 119, '_bptt_repeater_0_bptt__icon', 'field_5a36e5b146b7b'),
(2029, 119, 'bptt_repeater_0_bptt__text', 'HYBUILTS manufacturing process is the most efficient in the industry. This allows our continuous determination in lowering the cost of materials made possible across our clientele and customer base. HYBUILT Concrete sleepers are Certified by Registered Professional Engineers of Queensland (RPEQ). They are an Australian Manufactured Product meeting all Australian Building Standards.'),
(2030, 119, '_bptt_repeater_0_bptt__text', 'field_5a36e62546b7d'),
(2031, 119, 'bptt_repeater', '3'),
(2032, 119, '_bptt_repeater', 'field_5a36e58d46b7a'),
(2033, 119, 'bptt_repeater_0_bptt__title', 'Manufacturing'),
(2034, 119, '_bptt_repeater_0_bptt__title', 'field_5a36ec565e795'),
(2035, 119, 'bptt_repeater_1_bptt__icon', '55'),
(2036, 119, '_bptt_repeater_1_bptt__icon', 'field_5a36e5b146b7b'),
(2037, 119, 'bptt_repeater_1_bptt__scroll-anchor', '2'),
(2038, 119, '_bptt_repeater_1_bptt__scroll-anchor', 'field_5a36e5e346b7c'),
(2039, 119, 'bptt_repeater_1_bptt__title', 'Delivery'),
(2040, 119, '_bptt_repeater_1_bptt__title', 'field_5a36ec565e795'),
(2041, 119, 'bptt_repeater_1_bptt__text', 'We’re Queensland’s most efficient internal crane truck door to door/site to site services. Depending on the order size HYBUILT can usually deliver your materials within 2-3 days after order confirmation. To efficiently carry out these duties HYBUILT operates an entire fleet of Crane Trucks in a variety of sizes to suit both Load size and/or potential access constraints.'),
(2042, 119, '_bptt_repeater_1_bptt__text', 'field_5a36e62546b7d'),
(2043, 119, 'bptt_repeater_2_bptt__icon', '60'),
(2044, 119, '_bptt_repeater_2_bptt__icon', 'field_5a36e5b146b7b'),
(2045, 119, 'bptt_repeater_2_bptt__scroll-anchor', ''),
(2046, 119, '_bptt_repeater_2_bptt__scroll-anchor', 'field_5a36e5e346b7c'),
(2047, 119, 'bptt_repeater_2_bptt__title', 'Warranty'),
(2048, 119, '_bptt_repeater_2_bptt__title', 'field_5a36ec565e795'),
(2049, 119, 'bptt_repeater_2_bptt__text', 'HYBUILT’s 30yr Guarantee is applicable to walls that have been constructed to our design and specifications. Should a wall fail due to materials tampering, negligence and/or incorrect installation methods the warranty is void. However, should our products fail (without any external variables) we will replace them.'),
