(2284, 120, '_bptt_repeater_2_bptt__scroll-anchor', 'field_5a36e5e346b7c'),
(2285, 120, 'bptt_repeater_2_bptt__title', 'Warranty'),
(2286, 120, '_bptt_repeater_2_bptt__title', 'field_5a36ec565e795'),
(2287, 120, 'bptt_repeater_2_bptt__text', 'HYBUILT’s 30yr Guarantee is applicable to walls that have been constructed to our design and specifications. Should a wall fail due to materials tampering, negligence and/or incorrect installation methods the warranty is void. However, should our products fail (without any external variables) we will replace them.'),
(2288, 120, '_bptt_repeater_2_bptt__text', 'field_5a36e62546b7d'),
