(2570, 121, '_bptt_repeater_1_bptt__scroll-anchor', 'field_5a36e5e346b7c'),
(2571, 121, 'bptt_repeater_1_bptt__title', 'Delivery'),
(2572, 121, '_bptt_repeater_1_bptt__title', 'field_5a36ec565e795'),
(2573, 121, 'bptt_repeater_1_bptt__text', 'We’re Queensland’s most efficient internal crane truck door to door/site to site services. Depending on the order size HYBUILT can usually deliver your materials within 2-3 days after order confirmation. To efficiently carry out these duties HYBUILT operates an entire fleet of Crane Trucks in a variety of sizes to suit both Load size and/or potential access constraints.'),
(2574, 121, '_bptt_repeater_1_bptt__text', 'field_5a36e62546b7d'),
(2575, 121, 'bptt_repeater_2_bptt__icon', '60'),
