(4006, 126, 'bptt_repeater_1_bptt__icon', '55'),
(4007, 126, '_bptt_repeater_1_bptt__icon', 'field_5a36e5b146b7b'),
(4008, 126, 'bptt_repeater_1_bptt__scroll-anchor', '2'),
(4009, 126, '_bptt_repeater_1_bptt__scroll-anchor', 'field_5a36e5e346b7c'),
(4010, 126, 'bptt_repeater_1_bptt__title', 'Delivery'),
(4011, 126, '_bptt_repeater_1_bptt__title', 'field_5a36ec565e795'),
(4012, 126, 'bptt_repeater_1_bptt__text', 'We’re Queensland’s most efficient internal crane truck door to door/site to site services. Depending on the order size HYBUILT can usually deliver your materials within 2-3 days after order confirmation. To efficiently carry out these duties HYBUILT operates an entire fleet of Crane Trucks in a variety of sizes to suit both Load size and/or potential access constraints.'),
(4013, 126, '_bptt_repeater_1_bptt__text', 'field_5a36e62546b7d'),
(4014, 126, 'bptt_repeater_2_bptt__icon', '60'),
(4015, 126, '_bptt_repeater_2_bptt__icon', 'field_5a36e5b146b7b'),
(4016, 126, 'bptt_repeater_2_bptt__scroll-anchor', ''),
(4017, 126, '_bptt_repeater_2_bptt__scroll-anchor', 'field_5a36e5e346b7c'),
(4018, 126, 'bptt_repeater_2_bptt__title', 'Warranty'),
(4019, 126, '_bptt_repeater_2_bptt__title', 'field_5a36ec565e795'),
(4020, 126, 'bptt_repeater_2_bptt__text', 'HYBUILT’s 30yr Guarantee is applicable to walls that have been constructed to our design and specifications. Should a wall fail due to materials tampering, negligence and/or incorrect installation methods the warranty is void. However, should our products fail (without any external variables) we will replace them.'),
(4021, 126, '_bptt_repeater_2_bptt__text', 'field_5a36e62546b7d'),
