(5399, 131, '_bptt_repeater', 'field_5a36e58d46b7a'),
(5400, 131, 'bptt_repeater_0_bptt__title', 'Manufacturing'),
(5401, 131, '_bptt_repeater_0_bptt__title', 'field_5a36ec565e795'),
(5402, 131, 'bptt_repeater_1_bptt__icon', '55'),
(5403, 131, '_bptt_repeater_1_bptt__icon', 'field_5a36e5b146b7b'),
(5404, 131, 'bptt_repeater_1_bptt__scroll-anchor', '2'),
(5405, 131, '_bptt_repeater_1_bptt__scroll-anchor', 'field_5a36e5e346b7c'),
(5406, 131, 'bptt_repeater_1_bptt__title', 'Delivery'),
(5407, 131, '_bptt_repeater_1_bptt__title', 'field_5a36ec565e795'),
(5408, 131, 'bptt_repeater_1_bptt__text', 'We’re Queensland’s most efficient internal crane truck door to door/site to site services. Depending on the order size HYBUILT can usually deliver your materials within 2-3 days after order confirmation. To efficiently carry out these duties HYBUILT operates an entire fleet of Crane Trucks in a variety of sizes to suit both Load size and/or potential access constraints.'),
(5409, 131, '_bptt_repeater_1_bptt__text', 'field_5a36e62546b7d'),
(5410, 131, 'bptt_repeater_2_bptt__icon', '60'),
(5411, 131, '_bptt_repeater_2_bptt__icon', 'field_5a36e5b146b7b'),
(5412, 131, 'bptt_repeater_2_bptt__scroll-anchor', ''),
(5413, 131, '_bptt_repeater_2_bptt__scroll-anchor', 'field_5a36e5e346b7c'),
(5414, 131, 'bptt_repeater_2_bptt__title', 'Warranty'),
(5415, 131, '_bptt_repeater_2_bptt__title', 'field_5a36ec565e795'),
(5416, 131, 'bptt_repeater_2_bptt__text', 'HYBUILT’s 30yr Guarantee is applicable to walls that have been constructed to our design and specifications. Should a wall fail due to materials tampering, negligence and/or incorrect installation methods the warranty is void. However, should our products fail (without any external variables) we will replace them.'),
