INSERT INTO `wp_postmeta` ( `meta_id`, `post_id`, `meta_key`, `meta_value`) VALUES
(6823, 136, '_hcwh_image', 'field_5a383e7a804e4'),
(6824, 137, 'bptt_repeater_0_bptt__scroll-anchor', ''),
(6825, 137, '_bptt_repeater_0_bptt__scroll-anchor', 'field_5a36e5e346b7c'),
(6826, 137, 'bptt_repeater_0_bptt__icon', '46'),
(6827, 137, '_bptt_repeater_0_bptt__icon', 'field_5a36e5b146b7b'),
(6828, 137, 'bptt_repeater_0_bptt__text', 'HYBUILTS manufacturing process is the most efficient in the industry. This allows our continuous determination in lowering the cost of materials made possible across our clientele and customer base. HYBUILT Concrete sleepers are Certified by Registered Professional Engineers of Queensland (RPEQ). They are an Australian Manufactured Product meeting all Australian Building Standards.'),
(6829, 137, '_bptt_repeater_0_bptt__text', 'field_5a36e62546b7d'),
(6830, 137, 'bptt_repeater', '3'),
(6831, 137, '_bptt_repeater', 'field_5a36e58d46b7a'),
(6832, 137, 'bptt_repeater_0_bptt__title', 'Manufacturing'),
(6833, 137, '_bptt_repeater_0_bptt__title', 'field_5a36ec565e795'),
(6834, 137, 'bptt_repeater_1_bptt__icon', '55'),
(6835, 137, '_bptt_repeater_1_bptt__icon', 'field_5a36e5b146b7b'),
(6836, 137, 'bptt_repeater_1_bptt__scroll-anchor', '2'),
(6837, 137, '_bptt_repeater_1_bptt__scroll-anchor', 'field_5a36e5e346b7c'),
(6838, 137, 'bptt_repeater_1_bptt__title', 'Delivery'),
(6839, 137, '_bptt_repeater_1_bptt__title', 'field_5a36ec565e795'),
(6840, 137, 'bptt_repeater_1_bptt__text', 'We’re Queensland’s most efficient internal crane truck door to door/site to site services. Depending on the order size HYBUILT can usually deliver your materials within 2-3 days after order confirmation. To efficiently carry out these duties HYBUILT operates an entire fleet of Crane Trucks in a variety of sizes to suit both Load size and/or potential access constraints.'),
(6841, 137, '_bptt_repeater_1_bptt__text', 'field_5a36e62546b7d'),
(6842, 137, 'bptt_repeater_2_bptt__icon', '60'),
(6843, 137, '_bptt_repeater_2_bptt__icon', 'field_5a36e5b146b7b'),
(6844, 137, 'bptt_repeater_2_bptt__scroll-anchor', ''),
(6845, 137, '_bptt_repeater_2_bptt__scroll-anchor', 'field_5a36e5e346b7c'),
(6846, 137, 'bptt_repeater_2_bptt__title', 'Warranty'),
(6847, 137, '_bptt_repeater_2_bptt__title', 'field_5a36ec565e795'),
(6848, 137, 'bptt_repeater_2_bptt__text', 'HYBUILT’s 30yr Guarantee is applicable to walls that have been constructed to our design and specifications. Should a wall fail due to materials tampering, negligence and/or incorrect installation methods the warranty is void. However, should our products fail (without any external variables) we will replace them.'),
(6849, 137, '_bptt_repeater_2_bptt__text', 'field_5a36e62546b7d'),
