(8258, 140, 'bptt_repeater_0_bptt__scroll-anchor', ''),
(8259, 140, '_bptt_repeater_0_bptt__scroll-anchor', 'field_5a36e5e346b7c'),
(8260, 140, 'bptt_repeater_0_bptt__icon', '46'),
(8261, 140, '_bptt_repeater_0_bptt__icon', 'field_5a36e5b146b7b'),
(8262, 140, 'bptt_repeater_0_bptt__text', 'HYBUILTS manufacturing process is the most efficient in the industry. This allows our continuous determination in lowering the cost of materials made possible across our clientele and customer base. HYBUILT Concrete sleepers are Certified by Registered Professional Engineers of Queensland (RPEQ). They are an Australian Manufactured Product meeting all Australian Building Standards.'),
(8263, 140, '_bptt_repeater_0_bptt__text', 'field_5a36e62546b7d'),
(8264, 140, 'bptt_repeater', '3'),
(8265, 140, '_bptt_repeater', 'field_5a36e58d46b7a'),
(8266, 140, 'bptt_repeater_0_bptt__title', 'Manufacturing'),
(8267, 140, '_bptt_repeater_0_bptt__title', 'field_5a36ec565e795'),
(8268, 140, 'bptt_repeater_1_bptt__icon', '55'),
(8269, 140, '_bptt_repeater_1_bptt__icon', 'field_5a36e5b146b7b'),
(8270, 140, 'bptt_repeater_1_bptt__scroll-anchor', ''),
(8271, 140, '_bptt_repeater_1_bptt__scroll-anchor', 'field_5a36e5e346b7c'),
(8272, 140, 'bptt_repeater_1_bptt__title', 'Delivery'),
(8273, 140, '_bptt_repeater_1_bptt__title', 'field_5a36ec565e795'),
(8274, 140, 'bptt_repeater_1_bptt__text', 'We’re Queensland’s most efficient internal crane truck door to door/site to site services. Depending on the order size HYBUILT can usually deliver your materials within 2-3 days after order confirmation. To efficiently carry out these duties HYBUILT operates an entire fleet of Crane Trucks in a variety of sizes to suit both Load size and/or potential access constraints.'),
(8275, 140, '_bptt_repeater_1_bptt__text', 'field_5a36e62546b7d'),
(8276, 140, 'bptt_repeater_2_bptt__icon', '60'),
(8277, 140, '_bptt_repeater_2_bptt__icon', 'field_5a36e5b146b7b'),
(8278, 140, 'bptt_repeater_2_bptt__scroll-anchor', '2'),
(8279, 140, '_bptt_repeater_2_bptt__scroll-anchor', 'field_5a36e5e346b7c'),
(8280, 140, 'bptt_repeater_2_bptt__title', 'Warranty'),
(8281, 140, '_bptt_repeater_2_bptt__title', 'field_5a36ec565e795'),
(8282, 140, 'bptt_repeater_2_bptt__text', 'HYBUILT’s 30yr Guarantee is applicable to walls that have been constructed to our design and specifications. Should a wall fail due to materials tampering, negligence and/or incorrect installation methods the warranty is void. However, should our products fail (without any external variables) we will replace them.'),
