(8732, 140, 'hcwh_text', '<h2>How can we help?</h2>\r\nMore information about our sleeper and steel supplies? or Get a quick quote for your project?'),
(8733, 140, '_hcwh_text', 'field_5a383e5d804e3'),
(8734, 140, 'hcwh_image', '34'),
