(8745, 141, '_bptt_repeater_0_bptt__title', 'field_5a36ec565e795'),
(8746, 141, 'bptt_repeater_1_bptt__icon', '55'),
(8747, 141, '_bptt_repeater_1_bptt__icon', 'field_5a36e5b146b7b'),
