(8749, 141, '_bptt_repeater_1_bptt__scroll-anchor', 'field_5a36e5e346b7c'),
(8750, 141, 'bptt_repeater_1_bptt__title', 'Delivery'),
(8751, 141, '_bptt_repeater_1_bptt__title', 'field_5a36ec565e795'),
(8752, 141, 'bptt_repeater_1_bptt__text', 'We’re Queensland’s most efficient internal crane truck door to door/site to site services. Depending on the order size HYBUILT can usually deliver your materials within 2-3 days after order confirmation. To efficiently carry out these duties HYBUILT operates an entire fleet of Crane Trucks in a variety of sizes to suit both Load size and/or potential access constraints.'),
(8753, 141, '_bptt_repeater_1_bptt__text', 'field_5a36e62546b7d'),
(8754, 141, 'bptt_repeater_2_bptt__icon', '60'),
(8755, 141, '_bptt_repeater_2_bptt__icon', 'field_5a36e5b146b7b'),
(8756, 141, 'bptt_repeater_2_bptt__scroll-anchor', ''),
(8757, 141, '_bptt_repeater_2_bptt__scroll-anchor', 'field_5a36e5e346b7c'),
(8758, 141, 'bptt_repeater_2_bptt__title', 'Warranty'),
(8759, 141, '_bptt_repeater_2_bptt__title', 'field_5a36ec565e795'),
(8760, 141, 'bptt_repeater_2_bptt__text', 'HYBUILT’s 30yr Guarantee is applicable to walls that have been constructed to our design and specifications. Should a wall fail due to materials tampering, negligence and/or incorrect installation methods the warranty is void. However, should our products fail (without any external variables) we will replace them.'),
