(11743, 159, '_bptt_repeater_1_bptt__scroll-anchor', 'field_5a36e5e346b7c'),
(11744, 159, 'bptt_repeater_1_bptt__title', 'Delivery'),
(11745, 159, '_bptt_repeater_1_bptt__title', 'field_5a36ec565e795'),
(11746, 159, 'bptt_repeater_1_bptt__text', '<p class="p1"><span class="s1">We’re Queensland’s most efficient internal Tipper Truck and Trailers door to door / site to site services. HYBUILT boast a superior in house delivery system allowing us to maintain a continuous efficiency and competitive advantage over our competitors.</span></p>\r\n<p class="p1"><span class="s1">Orders must be placed with a minimum 1 week notice</span></p>\r\n\r\n<div class="delivering-to">\r\n\r\nDelivering to:\r\n<ul>\r\n 	<li>Brisbane</li>\r\n 	<li>Gold Coast</li>\r\n 	<li>Ipswich</li>\r\n 	<li>Sunshine Coast</li>\r\n</ul>\r\n</div>'),
(11747, 159, '_bptt_repeater_1_bptt__text', 'field_5a36e62546b7d'),
(11748, 159, 'bptt_repeater', '2'),
