(12123, 173, '_bptt_repeater_1_bptt__scroll-anchor', 'field_5a36e5e346b7c'),
(12124, 173, 'bptt_repeater_1_bptt__title', 'Delivery'),
(12125, 173, '_bptt_repeater_1_bptt__title', 'field_5a36ec565e795'),
(12126, 173, 'bptt_repeater_1_bptt__text', 'We’re Queensland’s most efficient internal crane truck door to door/site to site services. Depending on the order size HYBUILT can usually deliver your materials within 2-3 days after order confirmation. To efficiently carry out these duties HYBUILT operates an entire fleet of Crane Trucks in a variety of sizes to suit both Load size and/or potential access constraints.\r\n<div class="delivering-to">\r\n\r\nDelivering to:\r\n<ul>\r\n 	<li>Brisbane</li>\r\n 	<li>Gold Coast</li>\r\n 	<li>Ipswich</li>\r\n 	<li>Sunshine Coast</li>\r\n</ul>\r\n</div>'),
(12127, 173, '_bptt_repeater_1_bptt__text', 'field_5a36e62546b7d'),
(12128, 173, 'bptt_repeater_2_bptt__icon', '60'),
(12129, 173, '_bptt_repeater_2_bptt__icon', 'field_5a36e5b146b7b'),
(12130, 173, 'bptt_repeater_2_bptt__scroll-anchor', ''),
(12131, 173, '_bptt_repeater_2_bptt__scroll-anchor', 'field_5a36e5e346b7c'),
(12132, 173, 'bptt_repeater_2_bptt__title', 'Warranty'),
(12133, 173, '_bptt_repeater_2_bptt__title', 'field_5a36ec565e795'),
(12134, 173, 'bptt_repeater_2_bptt__text', 'HYBUILT’s 30yr Guarantee is applicable to walls that have been constructed to our design and specifications. Should a wall fail due to materials tampering, negligence and/or incorrect installation methods the warranty is void. However, should our products fail (without any external variables) we will replace them.'),
