(13496, 192, '_bptt_repeater_0_bptt__scroll-anchor', 'field_5a36e5e346b7c'),
(13497, 192, 'bptt_repeater_0_bptt__title', 'Our Team'),
(13498, 192, '_bptt_repeater_0_bptt__title', 'field_5a36ec565e795'),
(13499, 192, 'bptt_repeater_0_bptt__text', '<p class="p1"><span class="s1">With over 15 years of specialized industry experience, our precast team and office staff are able to provide quality advice and products for retaining project builds of any size. We pride ourselves on our expertise and workmanship, ensuring each of our supplied products and services meets our high standard of quality and the needs of your project. We\'re a reliable local team of experts dedicated to best practice concrete sleepers, steel, retaining wall and galvanized fence post solutions.</span></p>\r\n<a href="http://localhost:8888/hybuilt/contact/">CONTACT US</a>'),
(13500, 192, '_bptt_repeater_0_bptt__text', 'field_5a36e62546b7d'),
(13501, 192, 'bptt_repeater_1_bptt__icon', '46'),
