(13504, 192, '_bptt_repeater_1_bptt__scroll-anchor', 'field_5a36e5e346b7c'),
(13505, 192, 'bptt_repeater_1_bptt__title', 'Quality'),
(13506, 192, '_bptt_repeater_1_bptt__title', 'field_5a36ec565e795'),
(13507, 192, 'bptt_repeater_1_bptt__text', '<p class="p1"><span class="s1">The HYBUILT team specialises in the manufacturing of RPEQ Certified Concrete Sleepers designed to Australian Specs, Standards and engineering. This ensures that your wall is built to HYBUILT\'s high-quality standard and to Queensland\'s specifications. As a trusted concrete sleeper manufacturer &amp; galvanized fence post supplier.</span></p>'),
(13508, 192, '_bptt_repeater_1_bptt__text', 'field_5a36e62546b7d'),
(13509, 192, 'bptt_repeater_2_bptt__icon', ''),
