(14238, 210, '_bptt_repeater_0_bptt__title', 'field_5a36ec565e795'),
(14239, 210, 'bptt_repeater_0_bptt__text', '<p class="p1"><span class="s1">HYBUILT Sandstone is cut through a variety of methods dependant of the grade of choice:</span></p>\r\n<strong>A GRADE</strong>\r\n<p class="p1"><span class="s1">These premium blocks are available in both 5 or 6 sawn cut sides. If you’re after complete uniformity, A Grade Blocks will be the finish of choice. Commonly used on Heritage and High End developments as well as residential and commercial projects.</span></p>\r\n<strong>B GRADE</strong>\r\n<p class="p1"><span class="s1">The B Grade Sandstone Block offers the most natural appearance as expecting in Sandstone. B Grade demonstrates a beautifully raw finish which accents its texture and maximises its aesthetic appeal. By far the most popular choice amongst builders, developers, home owners and renovators. </span></p>\r\n<a href="#0" data-scroll-goto="4">View all prices</a>'),
(14240, 210, '_bptt_repeater_0_bptt__text', 'field_5a36e62546b7d'),
(14241, 210, 'bptt_repeater_1_bptt__icon', '55'),
(14242, 210, '_bptt_repeater_1_bptt__icon', 'field_5a36e5b146b7b'),
