(14244, 210, '_bptt_repeater_1_bptt__scroll-anchor', 'field_5a36e5e346b7c'),
(14245, 210, 'bptt_repeater_1_bptt__title', 'Delivery'),
(14246, 210, '_bptt_repeater_1_bptt__title', 'field_5a36ec565e795'),
(14247, 210, 'bptt_repeater_1_bptt__text', '<p class="p1"><span class="s1">We’re Queensland’s most efficient internal Tipper Truck and Trailers door to door / site to site services. HYBUILT boast a superior in house delivery system allowing us to maintain a continuous efficiency and competitive advantage over our competitors.</span></p>\r\n<p class="p1"><span class="s1">Orders must be placed with a minimum 1 week notice</span></p>\r\n\r\n<div class="delivering-to">\r\n\r\nDelivering to:\r\n<ul>\r\n 	<li>Brisbane</li>\r\n 	<li>Gold Coast</li>\r\n 	<li>Ipswich</li>\r\n 	<li>Sunshine Coast</li>\r\n</ul>\r\n</div>'),
(14248, 210, '_bptt_repeater_1_bptt__text', 'field_5a36e62546b7d'),
(14249, 210, 'bptt_repeater', '2'),
(14250, 210, '_bptt_repeater', 'field_5a36e58d46b7a'),
