INSERT INTO `wp_postmeta` ( `meta_id`, `post_id`, `meta_key`, `meta_value`) VALUES
(14401, 212, 'bptt_repeater_1_bptt__title', 'Delivery'),
(14402, 212, '_bptt_repeater_1_bptt__title', 'field_5a36ec565e795'),
(14403, 212, 'bptt_repeater_1_bptt__text', 'We’re Queensland’s most efficient internal crane truck door to door/site to site services. Depending on the order size HYBUILT can usually deliver your materials within 2-3 days after order confirmation. To efficiently carry out these duties HYBUILT operates an entire fleet of Crane Trucks in a variety of sizes to suit both Load size and/or potential access constraints.\r\n<div class="delivering-to">\r\n\r\nDelivering to:\r\n<ul>\r\n 	<li>Brisbane</li>\r\n 	<li>Gold Coast</li>\r\n 	<li>Ipswich</li>\r\n 	<li>Sunshine Coast</li>\r\n</ul>\r\n</div>'),
(14404, 212, '_bptt_repeater_1_bptt__text', 'field_5a36e62546b7d'),
(14405, 212, 'bptt_repeater_2_bptt__icon', '60'),
(14406, 212, '_bptt_repeater_2_bptt__icon', 'field_5a36e5b146b7b'),
(14407, 212, 'bptt_repeater_2_bptt__scroll-anchor', ''),
(14408, 212, '_bptt_repeater_2_bptt__scroll-anchor', 'field_5a36e5e346b7c'),
(14409, 212, 'bptt_repeater_2_bptt__title', 'Warranty'),
(14410, 212, '_bptt_repeater_2_bptt__title', 'field_5a36ec565e795'),
(14411, 212, 'bptt_repeater_2_bptt__text', 'HYBUILT’s 30yr Guarantee is applicable to walls that have been constructed to our design and specifications. Should a wall fail due to materials tampering, negligence and/or incorrect installation methods the warranty is void. However, should our products fail (without any external variables) we will replace them.'),
(14412, 212, '_bptt_repeater_2_bptt__text', 'field_5a36e62546b7d'),
(14413, 212, 'instal_gallery-bg', '72'),
(14414, 212, '_instal_gallery-bg', 'field_5a36f212b53b8'),
(14415, 212, 'instal_gallery-link', '24'),
(14416, 212, '_instal_gallery-link', 'field_5a36f69f47566'),
(14417, 212, 'instal_title', 'Residential & Commercial'),
