(14419, 212, 'instal_text', '<p class="p1"><span class="s1">Quisque ac imperdiet dui, quis consectetur enim. Fusce a finibus turpis. Etiam sed gravida libero. Pellentesque habitant morbi tristique senectus et netus et malesuada fames ac turpis egestas. Pellentesque interdum justo id arcu tristique imperdiet. Fusce feugiat imperdiet libero, sit amet pharetra leo.</span></p>\r\n<a href="http://localhost:8888/hybuilt/contact/">ENQUIRE</a>'),
