(15568, 224, 'bptt_repeater_0_bptt__title', 'Our Team'),
(15569, 224, '_bptt_repeater_0_bptt__title', 'field_5a36ec565e795'),
(15570, 224, 'bptt_repeater_0_bptt__text', '<p class="p1"><span class="s1">With over 15 years of specialized industry experience, our precast team and office staff are able to provide quality advice and products for retaining project builds of any size. We pride ourselves on our expertise and workmanship, ensuring each of our supplied products and services meets our high standard of quality and the needs of your project. We\'re a reliable local team of experts dedicated to best practice concrete sleepers, steel, retaining wall and galvanized fence post solutions.</span></p>\r\n<a href="http://localhost:8888/hybuilt/contact/">CONTACT US</a>'),
(15571, 224, '_bptt_repeater_0_bptt__text', 'field_5a36e62546b7d'),
(15572, 224, 'bptt_repeater_1_bptt__icon', '60'),
