(15585, 224, '_bptt_repeater_2_bptt__title', 'field_5a36ec565e795'),
(15586, 224, 'bptt_repeater_2_bptt__text', '<p class="p1">We\'re proud to boast a diverse and extensive portfolio of clientele around:</p>\r\n\r\n<div class="delivering-to">\r\n<ul>\r\n 	<li>Brisbane</li>\r\n 	<li>Gold Coast</li>\r\n 	<li>Ipswich</li>\r\n 	<li>Sunshine Coast</li>\r\n</ul>\r\n</div>'),
