INSERT INTO `wp_postmeta` ( `meta_id`, `post_id`, `meta_key`, `meta_value`) VALUES
(15611, 226, '_bptt_repeater_1_bptt__icon', 'field_5a36e5b146b7b'),
(15612, 226, 'bptt_repeater_1_bptt__scroll-anchor', '2'),
(15613, 226, '_bptt_repeater_1_bptt__scroll-anchor', 'field_5a36e5e346b7c'),
(15614, 226, 'bptt_repeater_1_bptt__title', 'Delivery'),
(15615, 226, '_bptt_repeater_1_bptt__title', 'field_5a36ec565e795'),
(15616, 226, 'bptt_repeater_1_bptt__text', 'We’re Queensland’s most efficient internal crane truck door to door/site to site services. Depending on the order size HYBUILT can usually deliver your materials within 2-3 days after order confirmation. To efficiently carry out these duties HYBUILT operates an entire fleet of Crane Trucks in a variety of sizes to suit both Load size and/or potential access constraints.\r\n<div class="delivering-to">\r\n\r\nDelivering to:\r\n<ul>\r\n 	<li>Brisbane</li>\r\n 	<li>Gold Coast</li>\r\n 	<li>Ipswich</li>\r\n 	<li>Sunshine Coast</li>\r\n</ul>\r\n</div>'),
(15617, 226, '_bptt_repeater_1_bptt__text', 'field_5a36e62546b7d'),
(15618, 226, 'bptt_repeater_2_bptt__icon', '60'),
(15619, 226, '_bptt_repeater_2_bptt__icon', 'field_5a36e5b146b7b'),
(15620, 226, 'bptt_repeater_2_bptt__scroll-anchor', ''),
(15621, 226, '_bptt_repeater_2_bptt__scroll-anchor', 'field_5a36e5e346b7c'),
(15622, 226, 'bptt_repeater_2_bptt__title', 'Warranty'),
(15623, 226, '_bptt_repeater_2_bptt__title', 'field_5a36ec565e795'),
(15624, 226, 'bptt_repeater_2_bptt__text', 'HYBUILT’s 30yr Guarantee is applicable to walls that have been constructed to our design and specifications. Should a wall fail due to materials tampering, negligence and/or incorrect installation methods the warranty is void. However, should our products fail (without any external variables) we will replace them.'),
(15625, 226, '_bptt_repeater_2_bptt__text', 'field_5a36e62546b7d'),
(15626, 226, 'instal_gallery-bg', '72'),
(15627, 226, '_instal_gallery-bg', 'field_5a36f212b53b8'),
(15628, 226, 'instal_gallery-link', '24'),
(15629, 226, '_instal_gallery-link', 'field_5a36f69f47566'),
(15630, 226, 'instal_title', 'Residential & Commercial'),
(15631, 226, '_instal_title', 'field_5a36f23bb53b9'),
(15632, 226, 'instal_text', 'HYBUILT competitive construction advantage is derived through in-house concrete sleeper manufacturing coupled with effective and realistic pricing without ever compromising on quality.\r\n\r\nHYBUILT Supply &amp; Installation include:\r\n<ol>\r\n 	<li>All Materials (Concrete sleepers, galvanised steel, drainage &amp; aggregate)</li>\r\n 	<li>All machinery (excavators, bobcats, trucks) and drilling</li>\r\n 	<li>All required labour</li>\r\n 	<li>Engineering &amp; Certification (if required)</li>\r\n 	<li>Complete Design &amp; Construction solution</li>\r\n</ol>\r\n<a href="http://localhost:8888/hybuilt/contact/">ENQUIRE</a>'),
