(16136, 227, 'bptt_repeater_0_bptt__title', 'Manufacturing'),
(16137, 227, '_bptt_repeater_0_bptt__title', 'field_5a36ec565e795'),
(16138, 227, 'bptt_repeater_1_bptt__icon', '55'),
(16139, 227, '_bptt_repeater_1_bptt__icon', 'field_5a36e5b146b7b'),
(16140, 227, 'bptt_repeater_1_bptt__scroll-anchor', '2'),
(16141, 227, '_bptt_repeater_1_bptt__scroll-anchor', 'field_5a36e5e346b7c'),
(16142, 227, 'bptt_repeater_1_bptt__title', 'Delivery'),
(16143, 227, '_bptt_repeater_1_bptt__title', 'field_5a36ec565e795'),
(16144, 227, 'bptt_repeater_1_bptt__text', 'We’re Queensland’s most efficient internal crane truck door to door/site to site services. Depending on the order size HYBUILT can usually deliver your materials within 2-3 days after order confirmation. To efficiently carry out these duties HYBUILT operates an entire fleet of Crane Trucks in a variety of sizes to suit both Load size and/or potential access constraints.\r\n<div class="delivering-to">\r\n\r\nDelivering to:\r\n<ul>\r\n 	<li>Brisbane</li>\r\n 	<li>Gold Coast</li>\r\n 	<li>Ipswich</li>\r\n 	<li>Sunshine Coast</li>\r\n</ul>\r\n</div>'),
(16145, 227, '_bptt_repeater_1_bptt__text', 'field_5a36e62546b7d'),
(16146, 227, 'bptt_repeater_2_bptt__icon', '60'),
(16147, 227, '_bptt_repeater_2_bptt__icon', 'field_5a36e5b146b7b'),
(16148, 227, 'bptt_repeater_2_bptt__scroll-anchor', ''),
(16149, 227, '_bptt_repeater_2_bptt__scroll-anchor', 'field_5a36e5e346b7c'),
(16150, 227, 'bptt_repeater_2_bptt__title', 'Warranty'),
(16151, 227, '_bptt_repeater_2_bptt__title', 'field_5a36ec565e795'),
(16152, 227, 'bptt_repeater_2_bptt__text', 'HYBUILT’s 30yr Guarantee is applicable to walls that have been constructed to our design and specifications. Should a wall fail due to materials tampering, negligence and/or incorrect installation methods the warranty is void. However, should our products fail (without any external variables) we will replace them.'),
(16153, 227, '_bptt_repeater_2_bptt__text', 'field_5a36e62546b7d'),
(16154, 227, 'instal_gallery-bg', '72'),
(16155, 227, '_instal_gallery-bg', 'field_5a36f212b53b8'),
(16156, 227, 'instal_gallery-link', '24'),
(16157, 227, '_instal_gallery-link', 'field_5a36f69f47566'),
(16158, 227, 'instal_title', 'Residential & Commercial'),
(16159, 227, '_instal_title', 'field_5a36f23bb53b9'),
(16160, 227, 'instal_text', 'HYBUILT<span style="color: #000000;"> competitive construction advantage is derived </span>through<span style="color: #000000;"> in-house concrete sleeper manufacturing coupled with effective and realistic pricing without ever compromising on quality.</span>\r\n\r\nHYBUILT<span style="color: #000000;"> Supply &amp; Installation include:</span>\r\n<ol>\r\n 	<li><span style="color: #000000;">All Materials (Concrete sleepers, galvanised steel, drainage &amp; aggregate)</span></li>\r\n 	<li>All machinery (excavators, bobcats, trucks) and drilling</li>\r\n 	<li>All required labour</li>\r\n 	<li>Engineering &amp; Certification (if required)</li>\r\n 	<li>Complete Design &amp; Construction solution</li>\r\n</ol>\r\n<a href="http://localhost:8888/hybuilt/contact/">ENQUIRE</a>'),
