(18362, 235, 'bptt_repeater_0_bptt__scroll-anchor', ''),
(18363, 235, '_bptt_repeater_0_bptt__scroll-anchor', 'field_5a36e5e346b7c'),
(18364, 235, 'bptt_repeater_0_bptt__icon', '46'),
(18365, 235, '_bptt_repeater_0_bptt__icon', 'field_5a36e5b146b7b'),
(18366, 235, 'bptt_repeater_0_bptt__text', 'HYBUILTS manufacturing process is the most efficient in the industry. This allows our continuous determination in lowering the cost of materials made possible across our clientele and customer base. HYBUILT Concrete sleepers are Certified by Registered Professional Engineers of Queensland (RPEQ). They are an Australian Manufactured Product meeting all Australian Building Standards.'),
(18367, 235, '_bptt_repeater_0_bptt__text', 'field_5a36e62546b7d'),
(18368, 235, 'bptt_repeater', '3'),
(18369, 235, '_bptt_repeater', 'field_5a36e58d46b7a'),
(18370, 235, 'bptt_repeater_0_bptt__title', 'Manufacturing'),
(18371, 235, '_bptt_repeater_0_bptt__title', 'field_5a36ec565e795'),
(18372, 235, 'bptt_repeater_1_bptt__icon', '55'),
(18373, 235, '_bptt_repeater_1_bptt__icon', 'field_5a36e5b146b7b'),
(18374, 235, 'bptt_repeater_1_bptt__scroll-anchor', '2'),
(18375, 235, '_bptt_repeater_1_bptt__scroll-anchor', 'field_5a36e5e346b7c'),
(18376, 235, 'bptt_repeater_1_bptt__title', 'Delivery'),
(18377, 235, '_bptt_repeater_1_bptt__title', 'field_5a36ec565e795'),
(18378, 235, 'bptt_repeater_1_bptt__text', 'We’re Queensland’s most efficient internal crane truck door to door/site to site services. Depending on the order size HYBUILT can usually deliver your materials within 2-3 days after order confirmation. To efficiently carry out these duties HYBUILT operates an entire fleet of Crane Trucks in a variety of sizes to suit both Load size and/or potential access constraints.\r\n<div class="delivering-to">\r\n\r\nDelivering to:\r\n<ul>\r\n 	<li>Brisbane</li>\r\n 	<li>Gold Coast</li>\r\n 	<li>Ipswich</li>\r\n 	<li>Sunshine Coast</li>\r\n</ul>\r\n</div>'),
(18379, 235, '_bptt_repeater_1_bptt__text', 'field_5a36e62546b7d'),
(18380, 235, 'bptt_repeater_2_bptt__icon', '60'),
(18381, 235, '_bptt_repeater_2_bptt__icon', 'field_5a36e5b146b7b'),
(18382, 235, 'bptt_repeater_2_bptt__scroll-anchor', ''),
(18383, 235, '_bptt_repeater_2_bptt__scroll-anchor', 'field_5a36e5e346b7c'),
(18384, 235, 'bptt_repeater_2_bptt__title', 'Warranty'),
(18385, 235, '_bptt_repeater_2_bptt__title', 'field_5a36ec565e795'),
(18386, 235, 'bptt_repeater_2_bptt__text', 'HYBUILT’s 30yr Guarantee is applicable to walls that have been constructed to our design and specifications. Should a wall fail due to materials tampering, negligence and/or incorrect installation methods the warranty is void. However, should our products fail (without any external variables) we will replace them.'),
(18387, 235, '_bptt_repeater_2_bptt__text', 'field_5a36e62546b7d'),
(18388, 235, 'instal_gallery-bg', '72'),
(18389, 235, '_instal_gallery-bg', 'field_5a36f212b53b8'),
(18390, 235, 'instal_gallery-link', '24'),
(18391, 235, '_instal_gallery-link', 'field_5a36f69f47566'),
(18392, 235, 'instal_title', 'Residential & Commercial'),
(18393, 235, '_instal_title', 'field_5a36f23bb53b9'),
(18394, 235, 'instal_text', 'HYBUILT competitive construction advantage is derived through in-house concrete sleeper manufacturing coupled with effective and realistic pricing without ever compromising on quality.\r\n\r\nHYBUILT Supply &amp; Installation include:\r\n<ol>\r\n 	<li>All Materials (Concrete sleepers, galvanised steel, drainage &amp; aggregate)</li>\r\n 	<li>All machinery (excavators, bobcats, trucks) and drilling</li>\r\n 	<li>All required labour</li>\r\n 	<li>Engineering &amp; Certification (if required)</li>\r\n 	<li>Complete Design &amp; Construction solution</li>\r\n</ol>\r\n<a href="http://localhost:8888/hybuilt/contact/">ENQUIRE</a>'),
(18395, 235, '_instal_text', 'field_5a36f28db53ba'),
