(20235, 246, '_bptt_repeater_2_bptt__scroll-anchor', 'field_5a36e5e346b7c'),
(20236, 246, 'bptt_repeater_2_bptt__title', 'Warranty'),
(20237, 246, '_bptt_repeater_2_bptt__title', 'field_5a36ec565e795'),
(20238, 246, 'bptt_repeater_2_bptt__text', 'HYBUILT’s 30yr Guarantee is applicable to walls that have been constructed to our design and specifications. Should a wall fail due to materials tampering, negligence and/or incorrect installation methods the warranty is void. However, should our products fail (without any external variables) we will replace them.'),
(20239, 246, '_bptt_repeater_2_bptt__text', 'field_5a36e62546b7d'),
(20240, 246, 'instal_gallery-bg', '72'),
(20241, 246, '_instal_gallery-bg', 'field_5a36f212b53b8'),
