(21273, 248, '_bptt_repeater_0_bptt__icon', 'field_5a36e5b146b7b'),
(21274, 248, 'bptt_repeater_0_bptt__text', 'HYBUILTS manufacturing process is the most efficient in the industry. This allows our continuous determination in lowering the cost of materials made possible across our clientele and customer base. HYBUILT Concrete sleepers are Certified by Registered Professional Engineers of Queensland (RPEQ). They are an Australian Manufactured Product meeting all Australian Building Standards.'),
(21275, 248, '_bptt_repeater_0_bptt__text', 'field_5a36e62546b7d'),
(21276, 248, 'bptt_repeater', '3'),
(21277, 248, '_bptt_repeater', 'field_5a36e58d46b7a'),
(21278, 248, 'bptt_repeater_0_bptt__title', 'Manufacturing'),
(21279, 248, '_bptt_repeater_0_bptt__title', 'field_5a36ec565e795'),
(21280, 248, 'bptt_repeater_1_bptt__icon', '55'),
(21281, 248, '_bptt_repeater_1_bptt__icon', 'field_5a36e5b146b7b'),
(21282, 248, 'bptt_repeater_1_bptt__scroll-anchor', '2'),
(21283, 248, '_bptt_repeater_1_bptt__scroll-anchor', 'field_5a36e5e346b7c'),
(21284, 248, 'bptt_repeater_1_bptt__title', 'Delivery'),
(21285, 248, '_bptt_repeater_1_bptt__title', 'field_5a36ec565e795'),
(21286, 248, 'bptt_repeater_1_bptt__text', 'We’re Queensland’s most efficient internal crane truck door to door/site to site services. Depending on the order size HYBUILT can usually deliver your materials within 2-3 days after order confirmation. To efficiently carry out these duties HYBUILT operates an entire fleet of Crane Trucks in a variety of sizes to suit both Load size and/or potential access constraints.\r\n<div class="delivering-to">\r\n\r\nDelivering to:\r\n<ul>\r\n 	<li>Brisbane</li>\r\n 	<li>Gold Coast</li>\r\n 	<li>Ipswich</li>\r\n 	<li>Sunshine Coast</li>\r\n</ul>\r\n</div>'),
(21287, 248, '_bptt_repeater_1_bptt__text', 'field_5a36e62546b7d'),
(21288, 248, 'bptt_repeater_2_bptt__icon', '60'),
(21289, 248, '_bptt_repeater_2_bptt__icon', 'field_5a36e5b146b7b'),
(21290, 248, 'bptt_repeater_2_bptt__scroll-anchor', ''),
(21291, 248, '_bptt_repeater_2_bptt__scroll-anchor', 'field_5a36e5e346b7c'),
(21292, 248, 'bptt_repeater_2_bptt__title', 'Warranty'),
(21293, 248, '_bptt_repeater_2_bptt__title', 'field_5a36ec565e795'),
(21294, 248, 'bptt_repeater_2_bptt__text', 'HYBUILT’s 30yr Guarantee is applicable to walls that have been constructed to our design and specifications. Should a wall fail due to materials tampering, negligence and/or incorrect installation methods the warranty is void. However, should our products fail (without any external variables) we will replace them.'),
(21295, 248, '_bptt_repeater_2_bptt__text', 'field_5a36e62546b7d'),
(21296, 248, 'instal_gallery-bg', '72'),
(21297, 248, '_instal_gallery-bg', 'field_5a36f212b53b8'),
(21298, 248, 'instal_gallery-link', '24'),
(21299, 248, '_instal_gallery-link', 'field_5a36f69f47566'),
(21300, 248, 'instal_title', 'Residential & Commercial'),
(21301, 248, '_instal_title', 'field_5a36f23bb53b9'),
(21302, 248, 'instal_text', 'HYBUILT competitive construction advantage is derived through in-house concrete sleeper manufacturing coupled with effective and realistic pricing without ever compromising on quality.\r\n\r\nHYBUILT Supply &amp; Installation include:\r\n<ol>\r\n 	<li>All Materials (Concrete sleepers, galvanised steel, drainage &amp; aggregate)</li>\r\n 	<li>All machinery (excavators, bobcats, trucks) and drilling</li>\r\n 	<li>All required labour</li>\r\n 	<li>Engineering &amp; Certification (if required)</li>\r\n 	<li>Complete Design &amp; Construction solution</li>\r\n</ol>\r\n<a href="http://localhost:8888/hybuilt/contact/">ENQUIRE</a>'),
