(21828, 249, 'instal_title', 'Residential & Commercial'),
(21829, 249, '_instal_title', 'field_5a36f23bb53b9'),
(21830, 249, 'instal_text', 'HYBUILT competitive construction advantage is derived through in-house concrete sleeper manufacturing coupled with effective and realistic pricing without ever compromising on quality.\r\n\r\nHYBUILT Supply &amp; Installation include:\r\n<ol>\r\n 	<li>All Materials (Concrete sleepers, galvanised steel, drainage &amp; aggregate)</li>\r\n 	<li>All machinery (excavators, bobcats, trucks) and drilling</li>\r\n 	<li>All required labour</li>\r\n 	<li>Engineering &amp; Certification (if required)</li>\r\n 	<li>Complete Design &amp; Construction solution</li>\r\n</ol>\r\n<a href="http://localhost:8888/hybuilt/contact/">ENQUIRE</a>'),
