(22464, 251, 'bptt_repeater_0_bptt__scroll-anchor', ''),
(22465, 251, '_bptt_repeater_0_bptt__scroll-anchor', 'field_5a36e5e346b7c'),
(22466, 251, 'bptt_repeater_0_bptt__icon', '46'),
(22467, 251, '_bptt_repeater_0_bptt__icon', 'field_5a36e5b146b7b'),
(22468, 251, 'bptt_repeater_0_bptt__text', 'HYBUILTS manufacturing process is the most efficient in the industry. This allows our continuous determination in lowering the cost of materials made possible across our clientele and customer base. HYBUILT Concrete sleepers are Certified by Registered Professional Engineers of Queensland (RPEQ). They are an Australian Manufactured Product meeting all Australian Building Standards.'),
(22469, 251, '_bptt_repeater_0_bptt__text', 'field_5a36e62546b7d'),
(22470, 251, 'bptt_repeater', '3'),
(22471, 251, '_bptt_repeater', 'field_5a36e58d46b7a'),
(22472, 251, 'bptt_repeater_0_bptt__title', 'Manufacturing'),
(22473, 251, '_bptt_repeater_0_bptt__title', 'field_5a36ec565e795'),
(22474, 251, 'bptt_repeater_1_bptt__icon', '55'),
(22475, 251, '_bptt_repeater_1_bptt__icon', 'field_5a36e5b146b7b'),
(22476, 251, 'bptt_repeater_1_bptt__scroll-anchor', '2'),
(22477, 251, '_bptt_repeater_1_bptt__scroll-anchor', 'field_5a36e5e346b7c'),
(22478, 251, 'bptt_repeater_1_bptt__title', 'Delivery'),
(22479, 251, '_bptt_repeater_1_bptt__title', 'field_5a36ec565e795'),
(22480, 251, 'bptt_repeater_1_bptt__text', 'We’re Queensland’s most efficient internal crane truck door to door/site to site services. Depending on the order size HYBUILT can usually deliver your materials within 2-3 days after order confirmation. To efficiently carry out these duties HYBUILT operates an entire fleet of Crane Trucks in a variety of sizes to suit both Load size and/or potential access constraints.\r\n<div class="delivering-to">\r\n\r\nDelivering to:\r\n<ul>\r\n 	<li>Brisbane</li>\r\n 	<li>Gold Coast</li>\r\n 	<li>Ipswich</li>\r\n 	<li>Sunshine Coast</li>\r\n 	<li>Northern NSW</li>\r\n</ul>\r\n</div>'),
(22481, 251, '_bptt_repeater_1_bptt__text', 'field_5a36e62546b7d'),
(22482, 251, 'bptt_repeater_2_bptt__icon', '60'),
(22483, 251, '_bptt_repeater_2_bptt__icon', 'field_5a36e5b146b7b'),
(22484, 251, 'bptt_repeater_2_bptt__scroll-anchor', ''),
(22485, 251, '_bptt_repeater_2_bptt__scroll-anchor', 'field_5a36e5e346b7c'),
(22486, 251, 'bptt_repeater_2_bptt__title', 'Warranty'),
(22487, 251, '_bptt_repeater_2_bptt__title', 'field_5a36ec565e795'),
(22488, 251, 'bptt_repeater_2_bptt__text', 'HYBUILT offers a superior 30yr guarantee on all our manufactured sleeper products to walls that have been constructed to our design &amp; specification. Terms &amp; Conditions Apply'),
(22489, 251, '_bptt_repeater_2_bptt__text', 'field_5a36e62546b7d'),
(22490, 251, 'instal_gallery-bg', '72'),
(22491, 251, '_instal_gallery-bg', 'field_5a36f212b53b8'),
(22492, 251, 'instal_gallery-link', '24'),
(22493, 251, '_instal_gallery-link', 'field_5a36f69f47566'),
(22494, 251, 'instal_title', 'Residential & Commercial'),
(22495, 251, '_instal_title', 'field_5a36f23bb53b9'),
(22496, 251, 'instal_text', 'HYBUILT competitive construction advantage is derived through in-house concrete sleeper manufacturing coupled with effective and realistic pricing without ever compromising on quality.\r\n\r\nHYBUILT Supply &amp; Installation include:\r\n<ol>\r\n 	<li>All Materials (Concrete sleepers, galvanised steel, drainage &amp; aggregate)</li>\r\n 	<li>All machinery (excavators, bobcats, trucks) and drilling</li>\r\n 	<li>All required labour</li>\r\n 	<li>Engineering &amp; Certification (if required)</li>\r\n 	<li>Complete Design &amp; Construction solution</li>\r\n</ol>\r\n<a href="http://localhost:8888/hybuilt/contact/">ENQUIRE</a>'),
