(24078, 258, '_bptt_repeater_2_bptt__scroll-anchor', 'field_5a36e5e346b7c'),
(24079, 258, 'bptt_repeater_2_bptt__title', 'Warranty'),
(24080, 258, '_bptt_repeater_2_bptt__title', 'field_5a36ec565e795'),
(24081, 258, 'bptt_repeater_2_bptt__text', 'HYBUILT offers a superior 30yr guarantee on all our manufactured sleeper products to walls that have been constructed to our design &amp; specification. Terms &amp; Conditions Apply'),
(24082, 258, '_bptt_repeater_2_bptt__text', 'field_5a36e62546b7d'),
