(24693, 271, 'bptt_repeater_0_bptt__title', 'Manufacturing'),
(24694, 271, '_bptt_repeater_0_bptt__title', 'field_5a36ec565e795'),
(24695, 271, 'bptt_repeater_1_bptt__icon', '55'),
(24696, 271, '_bptt_repeater_1_bptt__icon', 'field_5a36e5b146b7b'),
