(24698, 271, '_bptt_repeater_1_bptt__scroll-anchor', 'field_5a36e5e346b7c'),
(24699, 271, 'bptt_repeater_1_bptt__title', 'Delivery'),
(24700, 271, '_bptt_repeater_1_bptt__title', 'field_5a36ec565e795'),
(24701, 271, 'bptt_repeater_1_bptt__text', 'We’re Queensland’s most efficient internal crane truck door to door/site to site services. Depending on the order size HYBUILT can usually deliver your materials within 2-3 days after order confirmation. To efficiently carry out these duties HYBUILT operates an entire fleet of Crane Trucks in a variety of sizes to suit both Load size and/or potential access constraints.\r\n<div class="delivering-to">\r\n\r\nDelivering to:\r\n<ul>\r\n 	<li>Brisbane</li>\r\n 	<li>Gold Coast</li>\r\n 	<li>Ipswich</li>\r\n 	<li>Sunshine Coast</li>\r\n 	<li>Northern NSW</li>\r\n</ul>\r\n</div>'),
(24702, 271, '_bptt_repeater_1_bptt__text', 'field_5a36e62546b7d'),
(24703, 271, 'bptt_repeater_2_bptt__icon', '60'),
(24704, 271, '_bptt_repeater_2_bptt__icon', 'field_5a36e5b146b7b'),
(24705, 271, 'bptt_repeater_2_bptt__scroll-anchor', ''),
(24706, 271, '_bptt_repeater_2_bptt__scroll-anchor', 'field_5a36e5e346b7c'),
(24707, 271, 'bptt_repeater_2_bptt__title', 'Warranty'),
(24708, 271, '_bptt_repeater_2_bptt__title', 'field_5a36ec565e795'),
(24709, 271, 'bptt_repeater_2_bptt__text', 'HYBUILT offers a superior 30yr guarantee on all our manufactured sleeper products to walls that have been constructed to our design &amp; specification. Terms &amp; Conditions Apply'),
(24710, 271, '_bptt_repeater_2_bptt__text', 'field_5a36e62546b7d') ;
