(25234, 272, '_bptt_repeater_2_bptt__scroll-anchor', 'field_5a36e5e346b7c'),
(25235, 272, 'bptt_repeater_2_bptt__title', 'Warranty'),
(25236, 272, '_bptt_repeater_2_bptt__title', 'field_5a36ec565e795'),
(25237, 272, 'bptt_repeater_2_bptt__text', 'HYBUILT offers a superior 30yr guarantee on all our manufactured sleeper products to walls that have been constructed to our design &amp; specification. Terms &amp; Conditions Apply'),
(25238, 272, '_bptt_repeater_2_bptt__text', 'field_5a36e62546b7d'),
(25239, 272, 'instal_gallery-bg', '72'),
(25240, 272, '_instal_gallery-bg', 'field_5a36f212b53b8'),
(25241, 272, 'instal_gallery-link', '24'),
(25242, 272, '_instal_gallery-link', 'field_5a36f69f47566'),
(25243, 272, 'instal_title', 'Residential & Commercial'),
(25244, 272, '_instal_title', 'field_5a36f23bb53b9'),
(25245, 272, 'instal_text', 'HYBUILT competitive construction advantage is derived through in-house concrete sleeper manufacturing coupled with effective and realistic pricing without ever compromising on quality.\r\n\r\nHYBUILT Supply &amp; Installation include:\r\n<ol>\r\n 	<li>All Materials (Concrete sleepers, galvanised steel, drainage &amp; aggregate)</li>\r\n 	<li>All machinery (excavators, bobcats, trucks) and drilling</li>\r\n 	<li>All required labour</li>\r\n 	<li>Engineering &amp; Certification (if required)</li>\r\n 	<li>Complete Design &amp; Construction solution</li>\r\n</ol>\r\n<a href="http://localhost:8888/hybuilt/contact/">ENQUIRE</a>'),
