(27508, 278, '_instal_gallery-bg', 'field_5a36f212b53b8'),
(27509, 278, 'hcwh_text', '<h2>How can we help?</h2>\r\nMore information about our sandstone, concrete sleeper and steel supplies? or Get a quick quote for your project?'),
