(28019, 294, 'bptt_repeater_2_bptt__title', 'Warranty'),
(28020, 294, '_bptt_repeater_2_bptt__title', 'field_5a36ec565e795'),
(28021, 294, 'bptt_repeater_2_bptt__text', 'HYBUILT offers a superior 30yr guarantee on all our manufactured sleeper products to walls that have been constructed to our design &amp; specification. Terms &amp; Conditions Apply'),
(28022, 294, '_bptt_repeater_2_bptt__text', 'field_5a36e62546b7d'),
(28023, 294, 'instal_gallery-bg', '72'),
