(28026, 294, '_instal_gallery-link', 'field_5a36f69f47566'),
(28027, 294, 'instal_title', 'Residential & Commercial'),
(28028, 294, '_instal_title', 'field_5a36f23bb53b9'),
(28029, 294, 'instal_text', 'HYBUILT competitive construction advantage is derived through in-house concrete sleeper manufacturing coupled with effective and realistic pricing without ever compromising on quality.\r\n\r\nHYBUILT Supply &amp; Installation include:\r\n<ol>\r\n 	<li>All Materials (Concrete sleepers, galvanised steel, drainage &amp; aggregate)</li>\r\n 	<li>All machinery (excavators, bobcats, trucks) and drilling</li>\r\n 	<li>All required labour</li>\r\n 	<li>Engineering &amp; Certification (if required)</li>\r\n 	<li>Complete Design &amp; Construction solution</li>\r\n</ol>\r\n<a href="http://localhost:8888/hybuilt/contact/">ENQUIRE</a>'),
