(28556, 295, '_bptt_repeater_0_bptt__icon', 'field_5a36e5b146b7b'),
(28557, 295, 'bptt_repeater_0_bptt__text', 'HYBUILTS manufacturing process is the most efficient in the industry. This allows our continuous determination in lowering the cost of materials made possible across our clientele and customer base. HYBUILT Concrete sleepers are Certified by Registered Professional Engineers of Queensland (RPEQ). They are an Australian Manufactured Product meeting all Australian Building Standards.'),
(28558, 295, '_bptt_repeater_0_bptt__text', 'field_5a36e62546b7d'),
