(28562, 295, '_bptt_repeater_0_bptt__title', 'field_5a36ec565e795'),
(28563, 295, 'bptt_repeater_1_bptt__icon', '55'),
(28564, 295, '_bptt_repeater_1_bptt__icon', 'field_5a36e5b146b7b'),
(28565, 295, 'bptt_repeater_1_bptt__scroll-anchor', '2'),
(28566, 295, '_bptt_repeater_1_bptt__scroll-anchor', 'field_5a36e5e346b7c'),
(28567, 295, 'bptt_repeater_1_bptt__title', 'Delivery'),
(28568, 295, '_bptt_repeater_1_bptt__title', 'field_5a36ec565e795'),
(28569, 295, 'bptt_repeater_1_bptt__text', 'We’re Queensland’s most efficient internal crane truck door to door/site to site services. Depending on the order size HYBUILT can usually deliver your materials within 2-3 days after order confirmation. To efficiently carry out these duties HYBUILT operates an entire fleet of Crane Trucks in a variety of sizes to suit both Load size and/or potential access constraints.\r\n<div class="delivering-to">\r\n\r\nDelivering to:\r\n<ul>\r\n 	<li>Brisbane</li>\r\n 	<li>Gold Coast</li>\r\n 	<li>Ipswich</li>\r\n 	<li>Sunshine Coast</li>\r\n 	<li>Northern NSW</li>\r\n</ul>\r\n</div>'),
(28570, 295, '_bptt_repeater_1_bptt__text', 'field_5a36e62546b7d'),
(28571, 295, 'bptt_repeater_2_bptt__icon', '60'),
