(28574, 295, '_bptt_repeater_2_bptt__scroll-anchor', 'field_5a36e5e346b7c'),
(28575, 295, 'bptt_repeater_2_bptt__title', 'Warranty'),
(28576, 295, '_bptt_repeater_2_bptt__title', 'field_5a36ec565e795'),
(28577, 295, 'bptt_repeater_2_bptt__text', 'HYBUILT offers a superior 30yr guarantee on all our manufactured sleeper products to walls that have been constructed to our design &amp; specification. Terms &amp; Conditions Apply'),
(28578, 295, '_bptt_repeater_2_bptt__text', 'field_5a36e62546b7d'),
