(29130, 296, '_bptt_repeater_2_bptt__scroll-anchor', 'field_5a36e5e346b7c'),
(29131, 296, 'bptt_repeater_2_bptt__title', 'Warranty'),
(29132, 296, '_bptt_repeater_2_bptt__title', 'field_5a36ec565e795'),
(29133, 296, 'bptt_repeater_2_bptt__text', 'HYBUILT offers a superior 30yr guarantee on all our manufactured sleeper products to walls that have been constructed to our design &amp; specification. Terms &amp; Conditions Apply'),
(29134, 296, '_bptt_repeater_2_bptt__text', 'field_5a36e62546b7d'),
(29135, 296, 'instal_gallery-bg', '72'),
