(30248, 298, '_bptt_repeater_2_bptt__title', 'field_5a36ec565e795'),
(30249, 298, 'bptt_repeater_2_bptt__text', 'HYBUILT offers a superior 30yr guarantee on all our manufactured sleeper products to walls that have been constructed to our design &amp; specification. Terms &amp; Conditions Apply'),
(30250, 298, '_bptt_repeater_2_bptt__text', 'field_5a36e62546b7d'),
