INSERT INTO `wp_postmeta` ( `meta_id`, `post_id`, `meta_key`, `meta_value`) VALUES
(30813, 299, 'bptt_repeater_1_bptt__scroll-anchor', '2'),
(30814, 299, '_bptt_repeater_1_bptt__scroll-anchor', 'field_5a36e5e346b7c'),
(30815, 299, 'bptt_repeater_1_bptt__title', 'Delivery'),
(30816, 299, '_bptt_repeater_1_bptt__title', 'field_5a36ec565e795'),
(30817, 299, 'bptt_repeater_1_bptt__text', 'We’re Queensland’s most efficient internal crane truck door to door/site to site services. Depending on the order size HYBUILT can usually deliver your materials within 2-3 days after order confirmation. To efficiently carry out these duties HYBUILT operates an entire fleet of Crane Trucks in a variety of sizes to suit both Load size and/or potential access constraints.\r\n<div class="delivering-to">\r\n\r\nDelivering to:\r\n<ul>\r\n 	<li>Brisbane</li>\r\n 	<li>Gold Coast</li>\r\n 	<li>Ipswich</li>\r\n 	<li>Sunshine Coast</li>\r\n 	<li>Northern NSW</li>\r\n</ul>\r\n</div>'),
(30818, 299, '_bptt_repeater_1_bptt__text', 'field_5a36e62546b7d'),
(30819, 299, 'bptt_repeater_2_bptt__icon', '60'),
(30820, 299, '_bptt_repeater_2_bptt__icon', 'field_5a36e5b146b7b'),
(30821, 299, 'bptt_repeater_2_bptt__scroll-anchor', ''),
(30822, 299, '_bptt_repeater_2_bptt__scroll-anchor', 'field_5a36e5e346b7c'),
(30823, 299, 'bptt_repeater_2_bptt__title', 'Warranty'),
(30824, 299, '_bptt_repeater_2_bptt__title', 'field_5a36ec565e795'),
(30825, 299, 'bptt_repeater_2_bptt__text', 'HYBUILT offers a superior 30yr guarantee on all our manufactured sleeper products to walls that have been constructed to our design &amp; specification. Terms &amp; Conditions Apply'),
(30826, 299, '_bptt_repeater_2_bptt__text', 'field_5a36e62546b7d'),
(30827, 299, 'instal_gallery-bg', '72'),
(30828, 299, '_instal_gallery-bg', 'field_5a36f212b53b8'),
(30829, 299, 'instal_gallery-link', '24'),
(30830, 299, '_instal_gallery-link', 'field_5a36f69f47566'),
(30831, 299, 'instal_title', 'Residential & Commercial'),
(30832, 299, '_instal_title', 'field_5a36f23bb53b9'),
(30833, 299, 'instal_text', 'HYBUILT competitive construction advantage is derived through in-house concrete sleeper manufacturing coupled with effective and realistic pricing without ever compromising on quality.\r\n\r\nHYBUILT Supply &amp; Installation include:\r\n<ol>\r\n 	<li>All Materials (Concrete sleepers, galvanised steel, drainage &amp; aggregate)</li>\r\n 	<li>All machinery (excavators, bobcats, trucks) and drilling</li>\r\n 	<li>All required labour</li>\r\n 	<li>Engineering &amp; Certification (if required)</li>\r\n 	<li>Complete Design &amp; Construction solution</li>\r\n</ol>\r\n<a href="http://localhost:8888/hybuilt/contact/">ENQUIRE</a>'),
(30834, 299, '_instal_text', 'field_5a36f28db53ba'),
