(31996, 301, '_bptt_repeater_0_bptt__scroll-anchor', 'field_5a36e5e346b7c'),
(31997, 301, 'bptt_repeater_0_bptt__title', 'Stone finishes'),
(31998, 301, '_bptt_repeater_0_bptt__title', 'field_5a36ec565e795'),
(31999, 301, 'bptt_repeater_0_bptt__text', '<p class="p1"><span class="s1">HYBUILT Sandstone is cut through a variety of methods dependant of the grade of choice:</span></p>\r\n<strong>A GRADE</strong>\r\n<p class="p1"><span class="s1">These premium blocks are available in both 5 or 6 sawn cut sides. If you’re after complete uniformity, A Grade Blocks will be the finish of choice. Commonly used on Heritage and High End developments as well as residential and commercial projects.</span></p>\r\n<strong>B GRADE</strong>\r\n<p class="p1"><span class="s1">The B Grade Sandstone Block offers the most natural appearance as expecting in Sandstone. B Grade demonstrates a beautifully raw finish which accents its texture and maximises its aesthetic appeal. By far the most popular choice amongst builders, developers, home owners and renovators. </span></p>\r\n<a href="#0" data-scroll-goto="4">View all prices</a>'),
(32000, 301, '_bptt_repeater_0_bptt__text', 'field_5a36e62546b7d'),
(32001, 301, 'bptt_repeater_1_bptt__icon', '55'),
(32002, 301, '_bptt_repeater_1_bptt__icon', 'field_5a36e5b146b7b'),
(32003, 301, 'bptt_repeater_1_bptt__scroll-anchor', '2'),
(32004, 301, '_bptt_repeater_1_bptt__scroll-anchor', 'field_5a36e5e346b7c'),
(32005, 301, 'bptt_repeater_1_bptt__title', 'Delivery'),
(32006, 301, '_bptt_repeater_1_bptt__title', 'field_5a36ec565e795'),
(32007, 301, 'bptt_repeater_1_bptt__text', '<p class="p1"><span class="s1">We’re Queensland’s most efficient internal Tipper Truck and Trailers door to door / site to site services. HYBUILT boast a superior in house delivery system allowing us to maintain a continuous efficiency and competitive advantage over our competitors.</span></p>\r\n<p class="p1"><span class="s1">Orders must be placed with a minimum 1 week notice</span></p>\r\n\r\n<div class="delivering-to">\r\n\r\nDelivering to:\r\n<ul>\r\n 	<li>Brisbane</li>\r\n 	<li>Gold Coast</li>\r\n 	<li>Ipswich</li>\r\n 	<li>Sunshine Coast</li>\r\n 	<li>Northern NSW</li>\r\n</ul>\r\n</div>'),
(32008, 301, '_bptt_repeater_1_bptt__text', 'field_5a36e62546b7d'),
(32009, 301, 'bptt_repeater', '2'),
(32010, 301, '_bptt_repeater', 'field_5a36e58d46b7a'),
(32011, 301, 'instal_title', 'Residential & Commercial'),
(32012, 301, '_instal_title', 'field_5a36f23bb53b9'),
(32013, 301, 'instal_text', 'HYBUILT have partnered with only the most experienced Sandstone Installers across South East Queensland offering a complete Design &amp; Construct solution through competitive pricing and innovation.\r\n\r\nWe’ve quickly become Queensland\'s leading Sandstone Block Wall Installers &amp; Suppliers specialising in residential, industrial and civil projects.\r\n\r\nHYBUILT are arguably the most competitive installers in Queensland… How may you ask?… Through direct quarry supply arrangements coupled with effective and realistic pricing without ever compromising on quality.\r\n\r\nContact your HYBUILT representative now to book your next project.\r\n\r\n<a href="http://localhost:8888/hybuilt/contact/">ENQUIRE</a>'),
(32014, 301, '_instal_text', 'field_5a36f28db53ba'),
