(32429, 303, 'bptt_repeater_0_bptt__icon', '46'),
(32430, 303, '_bptt_repeater_0_bptt__icon', 'field_5a36e5b146b7b'),
(32431, 303, 'bptt_repeater_0_bptt__scroll-anchor', ''),
(32432, 303, '_bptt_repeater_0_bptt__scroll-anchor', 'field_5a36e5e346b7c'),
(32433, 303, 'bptt_repeater_0_bptt__title', 'Stone finishes'),
(32434, 303, '_bptt_repeater_0_bptt__title', 'field_5a36ec565e795'),
(32435, 303, 'bptt_repeater_0_bptt__text', '<p class="p1"><span class="s1">HYBUILT Sandstone is cut through a variety of methods dependant of the grade of choice:</span></p>\r\n<strong>A GRADE</strong>\r\n<p class="p1"><span class="s1">These premium blocks are available in both 5 or 6 sawn cut sides. If you’re after complete uniformity, A Grade Blocks will be the finish of choice. Commonly used on Heritage and High End developments as well as residential and commercial projects.</span></p>\r\n<strong>B GRADE</strong>\r\n<p class="p1"><span class="s1">The B Grade Sandstone Block offers the most natural appearance as expecting in Sandstone. B Grade demonstrates a beautifully raw finish which accents its texture and maximises its aesthetic appeal. By far the most popular choice amongst builders, developers, home owners and renovators. </span></p>\r\n<a href="#0" data-scroll-goto="4">View all prices</a>'),
(32436, 303, '_bptt_repeater_0_bptt__text', 'field_5a36e62546b7d') ;
INSERT INTO `wp_postmeta` ( `meta_id`, `post_id`, `meta_key`, `meta_value`) VALUES
(32437, 303, 'bptt_repeater_1_bptt__icon', '55'),
(32438, 303, '_bptt_repeater_1_bptt__icon', 'field_5a36e5b146b7b'),
(32439, 303, 'bptt_repeater_1_bptt__scroll-anchor', '2'),
(32440, 303, '_bptt_repeater_1_bptt__scroll-anchor', 'field_5a36e5e346b7c'),
(32441, 303, 'bptt_repeater_1_bptt__title', 'Delivery'),
(32442, 303, '_bptt_repeater_1_bptt__title', 'field_5a36ec565e795'),
(32443, 303, 'bptt_repeater_1_bptt__text', '<p class="p1"><span class="s1">We’re Queensland’s most efficient internal Tipper Truck and Trailers door to door / site to site services. HYBUILT boast a superior in house delivery system allowing us to maintain a continuous efficiency and competitive advantage over our competitors.</span></p>\r\n<p class="p1"><span class="s1">Orders must be placed with a minimum 1 week notice</span></p>\r\n\r\n<div class="delivering-to">\r\n\r\nDelivering to:\r\n<ul>\r\n 	<li>Brisbane</li>\r\n 	<li>Gold Coast</li>\r\n 	<li>Ipswich</li>\r\n 	<li>Sunshine Coast</li>\r\n 	<li>Northern NSW</li>\r\n</ul>\r\n</div>'),
