INSERT INTO `wp_postmeta` ( `meta_id`, `post_id`, `meta_key`, `meta_value`) VALUES
(32637, 305, 'bptt_repeater_1_bptt__title', 'Delivery'),
(32638, 305, '_bptt_repeater_1_bptt__title', 'field_5a36ec565e795'),
(32639, 305, 'bptt_repeater_1_bptt__text', '<p class="p1"><span class="s1">We’re Queensland’s most efficient internal Tipper Truck and Trailers door to door / site to site services. HYBUILT boast a superior in house delivery system allowing us to maintain a continuous efficiency and competitive advantage over our competitors.</span></p>\r\n<p class="p1"><span class="s1">Orders must be placed with a minimum 1 week notice</span></p>\r\n\r\n<div class="delivering-to">\r\n\r\nDelivering to:\r\n<ul>\r\n 	<li>Brisbane</li>\r\n 	<li>Gold Coast</li>\r\n 	<li>Ipswich</li>\r\n 	<li>Sunshine Coast</li>\r\n 	<li>Northern NSW</li>\r\n</ul>\r\n</div>'),
(32640, 305, '_bptt_repeater_1_bptt__text', 'field_5a36e62546b7d'),
(32641, 305, 'bptt_repeater', '2'),
(32642, 305, '_bptt_repeater', 'field_5a36e58d46b7a'),
(32643, 305, 'instal_title', 'Residential & Commercial'),
(32644, 305, '_instal_title', 'field_5a36f23bb53b9'),
(32645, 305, 'instal_text', 'HYBUILT have partnered with only the most experienced Sandstone Installers across South East Queensland offering a complete Design &amp; Construct solution through competitive pricing and innovation.\r\n\r\nWe’ve quickly become Queensland\'s leading Sandstone Block Wall Installers &amp; Suppliers specialising in residential, industrial and civil projects.\r\n\r\nHYBUILT are arguably the most competitive installers in Queensland… How may you ask?… Through direct quarry supply arrangements coupled with effective and realistic pricing without ever compromising on quality.\r\n\r\nContact your HYBUILT representative now to book your next project.\r\n\r\n<a href="http://localhost:8888/hybuilt/contact/">ENQUIRE</a>'),
(32646, 305, '_instal_text', 'field_5a36f28db53ba'),
