(32821, 307, 'bptt_repeater_0_bptt__icon', '46'),
(32822, 307, '_bptt_repeater_0_bptt__icon', 'field_5a36e5b146b7b'),
(32823, 307, 'bptt_repeater_0_bptt__scroll-anchor', ''),
(32824, 307, '_bptt_repeater_0_bptt__scroll-anchor', 'field_5a36e5e346b7c'),
(32825, 307, 'bptt_repeater_0_bptt__title', 'Stone finishes'),
(32826, 307, '_bptt_repeater_0_bptt__title', 'field_5a36ec565e795'),
(32827, 307, 'bptt_repeater_0_bptt__text', '<p class="p1"><span class="s1">HYBUILT Sandstone is cut through a variety of methods dependant of the grade of choice:</span></p>\r\n<strong>A GRADE</strong>\r\n<p class="p1"><span class="s1">These premium blocks are available in both 5 or 6 sawn cut sides. If you’re after complete uniformity, A Grade Blocks will be the finish of choice. Commonly used on Heritage and High End developments as well as residential and commercial projects.</span></p>\r\n<strong>B GRADE</strong>\r\n<p class="p1"><span class="s1">The B Grade Sandstone Block offers the most natural appearance as expecting in Sandstone. B Grade demonstrates a beautifully raw finish which accents its texture and maximises its aesthetic appeal. By far the most popular choice amongst builders, developers, home owners and renovators. </span></p>\r\n<a href="#0" data-scroll-goto="4">View all prices</a>'),
(32828, 307, '_bptt_repeater_0_bptt__text', 'field_5a36e62546b7d'),
(32829, 307, 'bptt_repeater_1_bptt__icon', '55'),
(32830, 307, '_bptt_repeater_1_bptt__icon', 'field_5a36e5b146b7b'),
(32831, 307, 'bptt_repeater_1_bptt__scroll-anchor', '2'),
(32832, 307, '_bptt_repeater_1_bptt__scroll-anchor', 'field_5a36e5e346b7c'),
(32833, 307, 'bptt_repeater_1_bptt__title', 'Delivery'),
(32834, 307, '_bptt_repeater_1_bptt__title', 'field_5a36ec565e795'),
(32835, 307, 'bptt_repeater_1_bptt__text', '<p class="p1"><span class="s1">We’re Queensland’s most efficient internal Tipper Truck and Trailers door to door / site to site services. HYBUILT boast a superior in house delivery system allowing us to maintain a continuous efficiency and competitive advantage over our competitors.</span></p>\r\n<p class="p1"><span class="s1">Orders must be placed with a minimum 1 week notice</span></p>\r\n\r\n<div class="delivering-to">\r\n\r\nDelivering to:\r\n<ul>\r\n 	<li>Brisbane</li>\r\n 	<li>Gold Coast</li>\r\n 	<li>Ipswich</li>\r\n 	<li>Sunshine Coast</li>\r\n 	<li>Northern NSW</li>\r\n</ul>\r\n</div>'),
(32836, 307, '_bptt_repeater_1_bptt__text', 'field_5a36e62546b7d'),
(32837, 307, 'bptt_repeater', '2'),
(32838, 307, '_bptt_repeater', 'field_5a36e58d46b7a') ;
INSERT INTO `wp_postmeta` ( `meta_id`, `post_id`, `meta_key`, `meta_value`) VALUES
(32839, 307, 'instal_title', 'Residential & Commercial'),
(32840, 307, '_instal_title', 'field_5a36f23bb53b9'),
(32841, 307, 'instal_text', 'HYBUILT have partnered with only the most experienced Sandstone Installers across South East Queensland offering a complete Design &amp; Construct solution through competitive pricing and innovation.\r\n\r\nWe’ve quickly become Queensland\'s leading Sandstone Block Wall Installers &amp; Suppliers specialising in residential, industrial and civil projects.\r\n\r\nHYBUILT are arguably the most competitive installers in Queensland… How may you ask?… Through direct quarry supply arrangements coupled with effective and realistic pricing without ever compromising on quality.\r\n\r\nContact your HYBUILT representative now to book your next project.\r\n\r\n<a href="http://localhost:8888/hybuilt/contact/">ENQUIRE</a>'),
(32842, 307, '_instal_text', 'field_5a36f28db53ba'),
(32843, 307, 'instal_text-bg-img', '306'),
