(33024, 310, '_bptt_repeater_0_bptt__title', 'field_5a36ec565e795'),
(33025, 310, 'bptt_repeater_0_bptt__text', '<p class="p1"><span class="s1">HYBUILT Sandstone is cut through a variety of methods dependant of the grade of choice:</span></p>\r\n<strong>A GRADE</strong>\r\n<p class="p1"><span class="s1">These premium blocks are available in both 5 or 6 sawn cut sides. If you’re after complete uniformity, A Grade Blocks will be the finish of choice. Commonly used on Heritage and High End developments as well as residential and commercial projects.</span></p>\r\n<strong>B GRADE</strong>\r\n<p class="p1"><span class="s1">The B Grade Sandstone Block offers the most natural appearance as expecting in Sandstone. B Grade demonstrates a beautifully raw finish which accents its texture and maximises its aesthetic appeal. By far the most popular choice amongst builders, developers, home owners and renovators. </span></p>\r\n<a href="#0" data-scroll-goto="4">View all prices</a>'),
(33026, 310, '_bptt_repeater_0_bptt__text', 'field_5a36e62546b7d'),
(33027, 310, 'bptt_repeater_1_bptt__icon', '55'),
(33028, 310, '_bptt_repeater_1_bptt__icon', 'field_5a36e5b146b7b'),
(33029, 310, 'bptt_repeater_1_bptt__scroll-anchor', '2'),
(33030, 310, '_bptt_repeater_1_bptt__scroll-anchor', 'field_5a36e5e346b7c'),
(33031, 310, 'bptt_repeater_1_bptt__title', 'Delivery'),
(33032, 310, '_bptt_repeater_1_bptt__title', 'field_5a36ec565e795'),
(33033, 310, 'bptt_repeater_1_bptt__text', '<p class="p1"><span class="s1">We’re Queensland’s most efficient internal Tipper Truck and Trailers door to door / site to site services. HYBUILT boast a superior in house delivery system allowing us to maintain a continuous efficiency and competitive advantage over our competitors.</span></p>\r\n<p class="p1"><span class="s1">Orders must be placed with a minimum 1 week notice</span></p>\r\n\r\n<div class="delivering-to">\r\n\r\nDelivering to:\r\n<ul>\r\n 	<li>Brisbane</li>\r\n 	<li>Gold Coast</li>\r\n 	<li>Ipswich</li>\r\n 	<li>Sunshine Coast</li>\r\n 	<li>Northern NSW</li>\r\n</ul>\r\n</div>'),
(33034, 310, '_bptt_repeater_1_bptt__text', 'field_5a36e62546b7d'),
