(34546, 319, 'bptt_repeater_0_bptt__icon', '46'),
(34547, 319, '_bptt_repeater_0_bptt__icon', 'field_5a36e5b146b7b'),
(34548, 319, 'bptt_repeater_0_bptt__scroll-anchor', ''),
(34549, 319, '_bptt_repeater_0_bptt__scroll-anchor', 'field_5a36e5e346b7c'),
(34550, 319, 'bptt_repeater_0_bptt__title', 'Stone finishes'),
(34551, 319, '_bptt_repeater_0_bptt__title', 'field_5a36ec565e795'),
(34552, 319, 'bptt_repeater_0_bptt__text', '<p class="p1"><span class="s1">HYBUILT Sandstone is cut through a variety of methods dependant of the grade of choice:</span></p>\r\n<strong>A GRADE</strong>\r\n<p class="p1"><span class="s1">These premium blocks are available in both 5 or 6 sawn cut sides. If you’re after complete uniformity, A Grade Blocks will be the finish of choice. Commonly used on Heritage and High End developments as well as residential and commercial projects.</span></p>\r\n<strong>B GRADE</strong>\r\n<p class="p1"><span class="s1">The B Grade Sandstone Block offers the most natural appearance as expecting in Sandstone. B Grade demonstrates a beautifully raw finish which accents its texture and maximises its aesthetic appeal. By far the most popular choice amongst builders, developers, home owners and renovators. </span></p>\r\n<a href="#0" data-scroll-goto="4">View all prices</a>'),
(34553, 319, '_bptt_repeater_0_bptt__text', 'field_5a36e62546b7d'),
(34554, 319, 'bptt_repeater_1_bptt__icon', '55'),
(34555, 319, '_bptt_repeater_1_bptt__icon', 'field_5a36e5b146b7b'),
(34556, 319, 'bptt_repeater_1_bptt__scroll-anchor', '2'),
(34557, 319, '_bptt_repeater_1_bptt__scroll-anchor', 'field_5a36e5e346b7c'),
(34558, 319, 'bptt_repeater_1_bptt__title', 'Delivery'),
(34559, 319, '_bptt_repeater_1_bptt__title', 'field_5a36ec565e795'),
(34560, 319, 'bptt_repeater_1_bptt__text', '<p class="p1"><span class="s1">We’re Queensland’s most efficient internal Tipper Truck and Trailers door to door / site to site services. HYBUILT boast a superior in house delivery system allowing us to maintain a continuous efficiency and competitive advantage over our competitors.</span></p>\r\n<p class="p1"><span class="s1">Orders must be placed with a minimum 1 week notice</span></p>\r\n\r\n<div class="delivering-to">\r\n\r\nDelivering to:\r\n<ul>\r\n 	<li>Brisbane</li>\r\n 	<li>Gold Coast</li>\r\n 	<li>Ipswich</li>\r\n 	<li>Sunshine Coast</li>\r\n 	<li>Northern NSW</li>\r\n</ul>\r\n</div>'),
(34561, 319, '_bptt_repeater_1_bptt__text', 'field_5a36e62546b7d'),
(34562, 319, 'bptt_repeater', '2'),
(34563, 319, '_bptt_repeater', 'field_5a36e58d46b7a'),
(34564, 319, 'instal_title', 'Residential & Commercial'),
(34565, 319, '_instal_title', 'field_5a36f23bb53b9'),
(34566, 319, 'instal_text', 'HYBUILT have partnered with only the most experienced Sandstone Installers across South East Queensland offering a complete Design &amp; Construct solution through competitive pricing and innovation.\r\n\r\nWe’ve quickly become Queensland\'s leading Sandstone Block Wall Installers &amp; Suppliers specialising in residential, industrial and civil projects.\r\n\r\nHYBUILT are arguably the most competitive installers in Queensland… How may you ask?… Through direct quarry supply arrangements coupled with effective and realistic pricing without ever compromising on quality.\r\n\r\nContact your HYBUILT representative now to book your next project.\r\n\r\n<a href="http://localhost:8888/hybuilt/contact/">ENQUIRE</a>'),
(34567, 319, '_instal_text', 'field_5a36f28db53ba'),
(34568, 319, 'instal_text-bg-img', '308'),
(34569, 319, '_instal_text-bg-img', 'field_5a36f2a747565'),
