(6, 1, '2017-12-14 01:42:34', '2017-12-14 01:42:34', '<h2 class="f-brand-blue bold">Premium Concrete Sleeper across Queensland</h2>\r\n\r\n<hr />\r\n<p class="p1">The experts at HYBUILT know concrete sleepers. We specialise in Manufacturing and direct supply of both premium concrete sleepers &amp; the required H and C posts across residential, commercial and industrial projects and developments. With over 15 years industry experience we’ve developed a reputation as Queensland’s trusted Sleeper Wall supplier. We pride ourselves on quality materials, expert customer service and fast turnaround times.</p>', 'Concrete sleepers', 'Concrete Precast Sleeper Manufacturers & Retaining wall supply specialists', 'publish', 'closed', 'closed', '', 'concrete-sleepers', '', '', '2018-02-06 03:32:52', '2018-02-06 03:32:52', '', 0, 'http://localhost:8888/hybuilt/?page_id=6', 0, 'page', '', 0),
