(8, 1, '2017-12-14 01:42:52', '2017-12-14 01:42:52', '<h2 class="f-brand-blue bold">Premium Sandstone Blocks across Queensland</h2>\r\n\r\n<hr />\r\n<p class="p1"><span class="s1">HYBUILT Sandstone is exclusively sourced from the most established quarry in Helidon QLD. Helidon Sandstone is by far the most superior stone both in Strength and Aesthetics over any comparable variants. </span></p>\r\n<p class="p2"><span class="s1">All stone supplied and delivered by HYBUILT is guaranteed for quality and durability </span></p>', 'Sandstone', 'Sandstone Retaining Wall specialists', 'publish', 'closed', 'closed', '', 'sandstone', '', '', '2018-02-06 22:06:09', '2018-02-06 22:06:09', '', 0, 'http://localhost:8888/hybuilt/?page_id=8', 0, 'page', '', 0),
